CREATE VIEW run_with_sleep AS
SELECT
    r.*,
    s.sleep_score,
    s.readiness_score,
    s.hrv,
    s.resting_hr,
    s.deep_sleep_min,
    s.rem_sleep_min,
    s.total_sleep_min
FROM runs r
LEFT JOIN sleep s ON r.date = s.date;

COMMIT;
